import * as React from 'react';
import Button from '@mui/material/Button'
import { lightGreen } from '@material-ui/core/colors';
import { Add, CenterFocusStrong } from "@mui/icons-material"
import { createTheme, ThemeProvider } from '@mui/material/styles';
import Stack from '@mui/material/Stack';
import handleupdate from '../../pages/user/User';



export default function UpdateUserIndication() {
    return (
        <Stack direction="row" spacing={2} margin={4}>
        <Button color="primary" variant="contained" onClick={handleUpdate}>
          Update
        </Button>
        <Button variant="outlined" color="secondary">
          Decline
        </Button>
      </Stack>
    )
}
